func TestDecodeHuffmanTree(t *testing.T) {
	table := CreateHuffmanByteTable([]byte(data))
	tree := BuildHuffmanTree(table)
	stream := EncodeHuffmanTree(tree)
	rebuildTree := DecodeHuffmanTree(stream)
	for _, pair := range tree.table {
		if _, val, ok := rebuildTree.FindByte(pair.Code); ok && pair.Data != val {
			t.Errorf("get %s from rebuild tree data want %02X got %02X", pair.Code, pair.Data, val)
		}
	}
}

func TestEncodeDecodePackStream(t *testing.T) {
	for _, repeat := range []int{1, 2, 3} {
		t.Run(fmt.Sprintf("repeat_time_%d", repeat), func(t *testing.T) {
			data = strings.Repeat(data, repeat)
			var data = []byte(data)
			if output, err := EncodeByte(data); err != nil {
				t.Error(err)
			} else {
				//compress := float64(len(output)) / float64(len(data))
				//fmt.Printf("compress/raw = %.2f%%\n", compress * 100)
				if decode, err := DecodeByte(output); err != nil {
					t.Error(err)
				} else {
					for index, ch := range data {
						if decode[index] != ch {
							t.Errorf("decode error offset %d want %02X get %02X", index, ch, decode[index])
							break
						}
					}
				}
			}
		})
	}
}

